import Nav from 'react-bootstrap/Nav';
import React from 'react';
import LoginPage from '../pages/LoginPage';
import LogsPage from '../pages/LogsPage';
import RequireAuth from './RequireAuth';
import SignupPage from '../pages/SignupPage';
import LogoutPage from '../pages/LogoutPage';
import { LinkContainer } from 'react-router-bootstrap'

export default function Navbar() {
  return (

        <Nav defaultActiveKey="/" as="ul" id="navbar">
            <Nav.Item as="li">
                <LinkContainer to="/"><Nav.Link className="nav-button">Dashboard</Nav.Link></LinkContainer>
            </Nav.Item>
            <Nav.Item as="li">
                <Nav.Link className="nav-button">Exercise</Nav.Link>
            </Nav.Item>
            <Nav.Item as="li">
                <LinkContainer><Nav.Link className="nav-button">Nutrition</Nav.Link></LinkContainer>
            </Nav.Item>
            <Nav.Item as="li">
                <LinkContainer to="/login"><Nav.Link className="nav-button" >Log In</Nav.Link></LinkContainer>
            </Nav.Item>
            <Nav.Item as="li">
                <LinkContainer to="/logout"><Nav.Link className="nav-button">Log Out</Nav.Link></LinkContainer>
            </Nav.Item>
            <Nav.Item as="li">
                <LinkContainer to="/signup"><Nav.Link className="nav-button">Sign Up</Nav.Link></LinkContainer>
            </Nav.Item>
        </Nav>


  );
}
